import React from 'react';
import { Link, useParams } from 'react-router-dom';
import { useState, useEffect } from 'react';
import axios from 'axios'
/*

NAMING SCHEME WHERE IM ACCESSIGN THE STATE FROM ANOTHER FUNCTION


